import React, { useState, useEffect } from 'react';
import { useHistory } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import Navbar8 from '../components/navbar8';
import Footer4 from '../components/footer4';
import './history.css';

const History = () => {
  const history = useHistory();
  const [isSignedIn, setIsSignedIn] = useState(false);
  const [scans, setScans] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const authenticated = localStorage.getItem('isAuthenticated') === 'true';
    setIsSignedIn(authenticated);

    if (authenticated) {
      fetchScanHistory();
    } else {
      setLoading(false);
    }
  }, []);

  const fetchScanHistory = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/emails'); // Change if different
      const data = await response.json();
      if (Array.isArray(data)) {
        setScans(data);
      }
    } catch (error) {
      console.error('Error fetching scan history:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleLogin = () => history.push('/signin');
  const handleMaybeLater = () => history.push('/');
  const handleNewAnalysis = () => history.push('/email-input');

  return (
    <div className="history-container">
      <Helmet>
        <title>Scan History</title>
      </Helmet>

      <Navbar8 link1="Home" link2="Email Input" link3="History" />

      <main className="history-content">
        {loading ? (
          <p>Loading your history...</p>
        ) : !isSignedIn ? (
          <div className="history-unsigned">
            <h2>Hold Up! You haven't Signed In yet.</h2>
            <p>Your scans are classified! Authenticate yourself first:</p>
            <div className="history-buttons">
              <button onClick={handleLogin} className="thq-button-filled">Login</button>
              <button onClick={handleMaybeLater} className="thq-button-outline">Maybe Later</button>
            </div>
          </div>
        ) : scans.length === 0 ? (
          <div className="history-noscans">
            <h2>Report: No Data Found</h2>
            <p>You haven't intercepted any emails yet!</p>
            <button onClick={handleNewAnalysis} className="thq-button-filled">
              Launch New Analysis
            </button>
          </div>
        ) : (
          <div className="history-scans">
            <h2>Classified Interceptions</h2>
            <div className="scan-list">
              {scans.map((scan) => (
                <div key={scan._id} className="scan-card">
                  <p><strong>Sender:</strong> {scan.senderEmail}</p>
                  <p><strong>Subject:</strong> {scan.subject}</p>
                  <p><strong>Content:</strong> {scan.content.slice(0, 100)}...</p>
                  <p><strong>Result:</strong> {scan.phishingResult.toUpperCase()}</p>
                  <p><strong>Date:</strong> {new Date(scan.createdAt).toLocaleString()}</p>
                </div>
              ))}
            </div>
          </div>
        )}
      </main>

      <Footer4 />
    </div>
  );
};

export default History;
